import React from "react";
import './style.scss'
export const CategorySec = () => {
    return(
        <div className="categorySec">
            <div className="categorySec__wrap">
                <div className="categorySec__head-wrap">
                    <p>Our popular <span>Category</span></p>
                </div>
            </div>
        </div>
    );
};
